import { ScrollIndicator } from '@src/ui/common/element/scrollIndicator';

const HomeIndexSection = () => {
  return <div className='homeIndexSection'>
    {/* <div class='dummyPlacer' /> */}
    <ScrollIndicator style={{visible: 'hidden',}} />
    <h1 class='targetLogoPlace'>MUsoftware</h1>
    <ScrollIndicator />
  </div>
}

export { HomeIndexSection }
